import axios from 'axios'
import types from '../../action/types'

const initialState = {
    user: {}
}


const userReducer = (state = initialState, action) => {
    switch (action.type) {
        case 'SET_USER':
            return action.payload
        case 'GET':
            return state;
        case 'REMOVE':
            return state;
        default:
            return state;
    }
}

export default userReducer;
